import React, {useState,useCallback,useEffect} from 'react';
import { Container, Row, Col, Card, Form, FormGroup } from 'reactstrap';
import MenuSuperior from '../menuSuperior/MenuSuperior';
import api from '../../api'

import { StickyTable, Rows, Cell } from 'react-sticky-table';

import { TextField, Select, MenuItem, InputLabel, Button } from "@material-ui/core";
import { withStyles } from '@material-ui/core/styles';


const CssTextField = withStyles({
    root: {
        "& label.Mui-focused": {
            color: "black"
        },
        "& label": {
            color: "black"
        },
        "& .MuiInput-underline:before": {
            borderBottomColor: "black"
        },
        "& .MuiInput-underline:after": {
            borderBottomColor: "black"
        },
        "& .MuiOutlinedInput-root": {
            "& fieldset": {
                borderColor: "black"
            },
            "&:hover fieldset": {
                borderColor: "black"
            },
            "&.Mui-focused fieldset": {
                borderColor: "black"
            }
        }
    }
})(TextField);

const Movimentacao = (props) => {
    function hoje() {
        var today = new Date();
        var dd = today.getDate();
        var mm = today.getMonth() + 1; //January is 0!

        var yyyy = today.getFullYear();
        if (dd < 10) {
            dd = '0' + dd;
        }
        if (mm < 10) {
            mm = '0' + mm;
        }
        var formatado = dd + '/' + mm + '/' + yyyy;
        var bd = yyyy + '' + mm + '' + dd;
        var valores = { 'formatado': formatado, 'bd': bd };
        return valores;
    }

    const [combocodigo, setCombocodigo] = useState([]);
   
    const for_cod = localStorage.getItem('for_cod')
    const [entcard, setEntcard] = useState([]);
    const [pedcard, setPedcard] = useState([]);
    const [trocard, setTrocard] = useState([]);   
    const [dfcard, setDfcard] = useState([]);
    const [tabela, setTabela] = useState([]);
    console.log(tabela);
    const [datainicial, setDatainicial] = useState([]);
    const [datafinal, setDatafinal] = useState([]);
    
    


    useEffect(() => {
        api.get(`combocodigo/${for_cod}/`).then(response => {
            setCombocodigo(response.data)
            
        })
    }, [for_cod]);

    useEffect(() => {
        api.get(`totitement/${for_cod}/${hoje().bd}/${hoje().bd}/`).then(response => {
            setEntcard(response.data)
            console.log(for_cod, hoje().bd )
        })
    }, [for_cod]);
    useEffect(() => {
        api.get(`totitempe/${for_cod}/${hoje().bd}/${hoje().bd}/`).then(response => {
            setPedcard(response.data)
        })
    }, [for_cod]);
    useEffect(() => {
        api.get(`totitemtr/${for_cod}/${hoje().bd}/${hoje().bd}/`).then(response => {
            setTrocard(response.data)
        })
    }, [for_cod]);
    useEffect(() => {
        api.get(`totitemdff/${for_cod}/${hoje().bd}/${hoje().bd}/`).then(response => {
            setDfcard(response.data)
        })
    }, [for_cod]);

  

    const [isActive5, setIsActive5] = useState(false); 

    function onChange1(ev) {
        const {name, value} = ev.target;
        setCombocodigo(value);
        if (ev !== '') {
            setIsActive5(true);
        } else {
            setIsActive5(false);
        }
    }

    function onChange2(ev) {
        const {name, value} = ev.target;
        setDatainicial(value); console.log(value);
    }

    function onChange3(ev) {
        const {name, value} = ev.target;
        setDatafinal(value); console.log(value);
    }

    const tabelamovimentacao = useCallback(() => {
        api.get(`totitementcod/${datainicial}/${datafinal}/${combocodigo}/`).then(response => {
            setTabela(response.data)
           
          
        })
    },[datainicial,datafinal, combocodigo]);


    return (
        <div>
            <MenuSuperior />
            <Container sm="12" md={{ size: 6, offset: 3 }}>
                <Row>
                    <Col >
                       {entcard.map(entcard =>(                      
                        <Card key={entcard} style={{ width: "100%", height: "200%", margin: '30px 0 0 0' }}>                            
                            <p><spam>Quantidade:{entcard.quantidade}</spam></p>
                            <p><spam>Total:{entcard.totalgeral}</spam></p>                            
                        </Card>                        
                        ))}
                    </Col>
                    <Col>
                        {pedcard.map(pedcard =>(                       
                        <Card key={pedcard} style={{ width: "100%", height: "200%", margin: '30px 0 0 0' }}>                            
                                <p>Quantidade:{pedcard.quantidade}</p>
                                <p>Total:{pedcard.totalgeral}</p>                            
                        </Card>
                         ))}
                    </Col>
                    <Col >
                        {trocard.map(trocard => (                       
                        <Card key={trocard} style={{ width: "100%", height: "200%", margin: '30px 0 0 0' }}>                            
                                <p>Quantidade:{trocard.quantidade}</p>
                                <p>Total:{trocard.totalgeral}</p>                            
                        </Card>
                         ))}
                    </Col>
                    <Col>
                        {dfcard.map(dfcard =>(                        
                        <Card key={dfcard} style={{ width: "100%", height: "200%", margin: '30px 0 0 0' }}>                            
                                <p>Quantidade:{dfcard.quantidade}</p>
                                <p>Total:{dfcard.totalgeral}</p>                            
                        </Card>
                        ))}
                    </Col>
                </Row>
                <Row>
                    <Col md={4}>
                        <FormGroup >
                            <InputLabel id="select-label"></InputLabel>
                            <Select
                                labelId="select-label"
                                id="select"
                                label="Buscar"
                                style={{ width: "100%", height: "40%", margin: '150px 0 0 400px' }}
                            >
                                <MenuItem selected disabled value="">Selecione Opo</MenuItem>
                                <MenuItem value="">Entradas</MenuItem>
                                <MenuItem value="">Devolues</MenuItem>
                                <MenuItem value="">Pedidos</MenuItem>
                                <MenuItem value="">Troca</MenuItem>
                            </Select>
                        </FormGroup>
                    </Col>
                </Row>
                <Row>
                    <Col md={4}>
                        <FormGroup >
                            <InputLabel id="select-label"></InputLabel>
                            <Select
                                labelId="select-label"
                                id="select"
                                label="Acesso a Tabela"
                                style={{ width: "100%", height: "40%", margin: '0 0 0 400px' }}
                            >
                                <MenuItem selected disabled value="">Selecione Opo</MenuItem>
                                <MenuItem value="1">Todos os Cdigo</MenuItem>
                                <MenuItem value="2">Por Cdigo</MenuItem>
                                <MenuItem value="3">Por Documento Itens</MenuItem>
                            </Select>
                        </FormGroup>
                    </Col>
                </Row>
                {/* ENTRADAS */ }
                <Row>
                    <Col sm={12} md={4} lg={4} xl={4} >
                        <Card style={{ width: "100%", height: "80%", margin: '15% 0 0 -100px' }}>
                            <FormGroup>
                                <Row>
                                    <Col>
                                        <TextField
                                            id="standard-data-input"
                                            label="De:"
                                            type="data"
                                            style={{ margin: '0 0 0 15%', width: "100%" }}
                                            onChange={onChange2}
                                        />
                                    </Col>
                                    <Col >
                                        <TextField
                                            id="standard-data-input"
                                            label="At:"
                                            type="data"
                                            style={{ margin: '0 0 0 15%', width: "100%" }}
                                            onChange={onChange3}
                                        />
                                    </Col>
                                </Row>
                            </FormGroup>
                            <FormGroup >
                                <InputLabel id="select-label"></InputLabel>
                                <Select
                                    labelId="select-label"
                                    id="select"
                                    label="Buscar"
                                    style={{ width: "90%", height: "100%", margin: '0 0 0 5%' }}
                                    onChange={onChange1}
                                >
                                    <MenuItem selected disabled value="">Selecione Opo</MenuItem>                                    
                                        {combocodigo.map(combocodigo => (
                                            <MenuItem key={combocodigo.for_cod} value={combocodigo.for_cod} > {combocodigo.for_cod+' - '+combocodigo.for_nom}</MenuItem>
                                        ))} 
                                </Select>
                            </FormGroup>                        
                            <Row>
                                <Col sm={12}>
                                    <FormGroup>
                                        <Button onClick={tabelamovimentacao} style={{ background: "#007bff", color: "#fff", borderRadius: "0%", width: "40%", height: "10%", margin: '5% 0 0 5%', fontSize: "13px" }}>Filtrar</Button>{' '}
                                        <Button style={{ background: "#007bff", color: "#fff", borderRadius: "0%", width: "40%", height: "10%", margin: '5% 0 0 5%', fontSize: "13px" }}>Baixar PDF</Button>{' '}
                                        <Button style={{ background: "#007bff", color: "#fff", borderRadius: "0%", width: "40%", height: "10%", margin: '5% 0 0 5%', fontSize: "13px" }}>Baixar Excel</Button>{' '}

                                    </FormGroup>
                                </Col>
                            </Row>
                        </Card>
                    </Col>
                    {/*TABELA 1 TODOS OS CDIGOS*/}
                    <StickyTable style={{ width: '200%', height: '400px', margin: '-21% 0 0 30%' }}>
                        <Rows>
                            <Cell style={{ background: '#007bff', color: 'white' }}>NOME FOR</Cell>
                            <Cell style={{ background: '#007bff', color: 'white' }}>COD. FOR.</Cell>
                            <Cell style={{ background: '#007bff', color: 'white' }}>VALOR</Cell>
                            <Cell style={{ background: '#007bff', color: 'white' }}>QUANTIDADE</Cell>
                            <Cell style={{ background: '#007bff', color: 'white' }}>LOJA</Cell>
                            <Cell style={{ background: '#007bff', color: 'white' }}>DOCUMENTO</Cell>
                        </Rows>
                        {tabela.map((tabela, idx) => ( 
                        <Rows key={idx}  tabela={tabela}>
                            <Cell>{}</Cell>
                            <Cell>{}</Cell>
                            <Cell>{tabela.totalgeral}</Cell>
                            <Cell>{tabela.quantidade}</Cell>
                            <Cell>{tabela.loja_origem}</Cell>
                            <Cell>{tabela.documento}</Cell>
                        </Rows>
                        ))}
                    </StickyTable>
                </Row>
                
                <Row>
                    <Col sm={12} md={4} lg={4} xl={4} >
                        <Card style={{ width: "100%", height: "80%", margin: '15% 0 0 -100px' }}>
                            <FormGroup>
                                <Row>
                                    <Col>
                                        <TextField
                                            id="standard-data-input"
                                            label="De:"
                                            type="data"
                                            style={{ margin: '0 0 0 15%', width: "100%" }}
                                        />
                                    </Col>
                                    <Col >
                                        <TextField
                                            id="standard-data-input"
                                            label="At:"
                                            type="data"
                                            style={{ margin: '0 0 0 15%', width: "100%" }}
                                        />
                                    </Col>
                                </Row>
                            </FormGroup>
                            <FormGroup >
                                <InputLabel id="select-label"></InputLabel>
                                <Select
                                    labelId="select-label"
                                    id="select"
                                    label="Buscar"
                                    style={{ width: "90%", height: "100%", margin: '0 0 0 5%' }}
                                >
                                    <MenuItem selected disabled value="">Selecione Opo</MenuItem>
                                    <MenuItem value=""></MenuItem>
                                    <MenuItem value=""></MenuItem>
                                    <MenuItem value=""></MenuItem>
                                </Select>
                            </FormGroup>
                            <Row>
                                <Col sm={12}>
                                    <FormGroup>
                                        <Button style={{ background: "#007bff", color: "#fff", borderRadius: "0%", width: "40%", height: "10%", margin: '5% 0 0 5%', fontSize: "13px" }}>Filtrar</Button>{' '}
                                        <Button style={{ background: "#007bff", color: "#fff", borderRadius: "0%", width: "40%", height: "10%", margin: '5% 0 0 5%', fontSize: "13px" }}>Baixar PDF</Button>{' '}
                                        <Button style={{ background: "#007bff", color: "#fff", borderRadius: "0%", width: "40%", height: "10%", margin: '5% 0 0 5%', fontSize: "13px" }}>Baixar Excel</Button>{' '}

                                    </FormGroup>
                                </Col>
                            </Row>
                        </Card>
                    </Col>
                    {/*TABELA 2 POR CDIGO */}
                    <StickyTable style={{ width: '200%', height: '400px', margin: '-21% 0 0 30%' }}>
